    return (
            <div className="container mt-5 mx-auto" >
                <label for="exampleInputEmail1" className="form-label h1 w-100 text-center">Menu</label>
                <br/><br/>
                <center>
                    <Link className="btn btn-primary px-5 pb-0" to="/getInventario">Hola</Link>
                <button type="button" className="btn btn-primary px-5 pb-0" to="/getInventario"><h5>VER IVENTARIO</h5> </button>
                </center>
            </div>
    );
  }

